import "./Header.css";
import SearchBar from "./SearchBar";
import logo from "../logo/logo.png";

export default function Header() {
  return (
    <header className="main-header">
      <div className="logo">
        <a href="/">
          <img src={logo} alt="logo" />
        </a>
      </div>

      <button className="nav-btn">
        <ion-icon name="menu-sharp"></ion-icon>
      </button>
    </header>
  );
}
